function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }

export function Initialize()
{
    //41 02: Set manual control
    //This is a completely manual mode. Once enabled, the device goes black and simply waits for control commands to set LEDs. The relevant packets are described at the end of this documents.
    //
    //This is also the mode used by the official SDK to set effects. The official control software only goes into this mode for the "System Status" pseudo-effect.
    sendPacketString("00 41 02 00 00 00",65); 
    device.pause(1);
}
 
function sendPacketString(string, size){

    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[i] =parseInt(data[i],16)//.toString(16)
    }
    device.write(packet, size);
}

export function Shutdown()
{
    // I have no clue why this is being used. Didn't found documentation on this anywhere so I will left this untouched
    sendPacketString("00 41 80",65);   
    device.pause(1);
    // Set the mode when the device is disconnected
    sendPacketString("00 51 28 00 00 07",65);
    device.pause(1);
}

